import React from "react";

function Footer() {
  return (
    <footer>
      Created by Denisse Rivera
      <p>
        <img src={Github} alt="Github" />
        <a href="https://github.com/RiveraDenisse">
          https://github.com/RiveraDenisse
        </a>
      </p>
    </footer>
  );
}

export default Footer;
